import React, { useState, useEffect } from 'react';
import { Form, Button, ListGroup } from 'react-bootstrap';
import axios from 'axios';

const Metas = () => {
  const [meta, setMeta] = useState({
    id_usuario: '',  // Você pode preencher esse campo com o ID do usuário logado
    tipo_atividade: '',
    valor_meta: '',
    data_inicial: '',
    data_final: '',
    status_meta: '',
  });

  const [metas, setMetas] = useState([]);

  // Função para buscar metas da API
  const fetchMetas = async () => {
    try {
      const response = await axios.get('https://sua-api.com/metas'); // Substitua pela URL da sua API
      setMetas(response.data);
    } catch (error) {
      console.error('Erro ao buscar metas:', error);
    }
  };

  useEffect(() => {
    fetchMetas();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setMeta((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Enviar dados para a API para registrar a nova meta
      await axios.post('https://sua-api.com/metas', meta); // Substitua pela URL da sua API
      setMetas([...metas, meta]); // Adiciona a nova meta ao estado local
      setMeta({ id_usuario: '', tipo_atividade: '', valor_meta: '', data_inicial: '', data_final: '', status_meta: '' }); // Limpa o formulário
    } catch (error) {
      console.error('Erro ao registrar meta:', error);
    }
  };

  return (
    <div>
      <h2>Registrar Meta</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>ID do Usuário</Form.Label>
          <Form.Control 
            type="text" 
            name="id_usuario" 
            value={meta.id_usuario} 
            onChange={handleChange} 
            placeholder="Digite o ID do usuário" 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Tipo de Atividade</Form.Label>
          <Form.Control 
            type="text" 
            name="tipo_atividade" 
            value={meta.tipo_atividade} 
            onChange={handleChange} 
            placeholder="Digite o tipo de atividade" 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Valor da Meta</Form.Label>
          <Form.Control 
            type="number" 
            name="valor_meta" 
            value={meta.valor_meta} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Data Inicial</Form.Label>
          <Form.Control 
            type="date" 
            name="data_inicial" 
            value={meta.data_inicial} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Data Final</Form.Label>
          <Form.Control 
            type="date" 
            name="data_final" 
            value={meta.data_final} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Status da Meta</Form.Label>
          <Form.Control 
            type="text" 
            name="status_meta" 
            value={meta.status_meta} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Button type="submit">Adicionar</Button>
      </Form>

      <ListGroup className="mt-3">
        {metas.map((item, index) => (
          <ListGroup.Item key={index}>
            {`Atividade: ${item.tipo_atividade} - Meta: ${item.valor_meta} - De: ${item.data_inicial} até: ${item.data_final} - Status: ${item.status_meta}`}
          </ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};

export default Metas;
